import React,{Component} from 'react';
import {Link} from 'react-router-dom';
//import cookie from 'react-cookies';
//import {Redirect} from 'react-router';

class Navbar extends Component {


    render(){

        return(
            <div>
                <nav class="Navbar-div">
                <div class="container-fluid">
                    <div class="navbar-header">
                        <a class="Navbar navbar-brand navbar-nav" href=""></a>
                    </div>
                    <div>Address</div>
                    <div>
                    <span class="input-group-addon"><img src="https://img.icons8.com/material-outlined/24/000000/search.png"></img></span>
                    <input type="text" placeholder="Pizza, sushi, chinese" name="search" id="search"></input>
                    </div>
                    <ul class="nav navbar-nav">

                    </ul>
                    <ul class="nav navbar-nav navbar-right">
                    <li class="bag-icon">
                    <span>Hi, Yesha</span>
                    </li>
                    <li>
                    <div>
                        <img class="bag-icon"></img>
                    </div>
                    </li>
                    </ul>
                </div>

            </nav> 
            </div>

        )
    }

}

export default Navbar;
